class Report {
  private $db;

  public function __construct($db) {
    $this->db = $db;
  }

  public function generate($table, $fields, $criteria) {
    $query = "SELECT " . implode(", ", $fields) . " FROM " . $table;

    if (!empty($criteria)) {
      $query .= " WHERE " . $criteria;
    }

    $result = $this->db->query($query);
    $data = [];

    while ($row = $result->fetch_assoc()) {
      $data[] = $row;
    }

    return $data;
  }
}
