Here is an example of how you might implement a binary semaphore in a separate class that you can use in your main code:
```
public class BinarySemaphore {
    private final Object lock = new Object();
    private volatile boolean taken = false;

    public void acquire() throws InterruptedException {
        synchronized (lock) {
            while (taken) {
                lock.wait();
            }
            taken = true;
        }
    }

    public void release() {
        synchronized (lock) {
            taken = false;
            lock.notify();
        }
    }
}
```
This implementation of a binary semaphore uses a `volatile` field and the `wait()` method to implement a thread-safe wait loop that consumes fewer CPU resources than using a `while` loop with the `wait()` method alone.

To use the binary semaphore in your main code, you can simply create an instance of the `BinarySemaphore` class and call the `acquire()` and `release()` methods as needed:
```
BinarySemaphore semaphore = new BinarySemaphore();

// acquire the semaphore
semaphore.acquire();

// critical section of code goes here

// release the semaphore
semaphore.release();
```
This will allow you to synchronize access to shared resources and protect critical sections of code in a multithreaded environment.

