public boolean lock(int uuid) throws InterruptedException {
    // ...
    Node curr = node.parent;
    while (curr != null) {
        curr.acquire();
        if (curr.isLocked) {
            curr.release();
            release();
            return false;
        }
        curr = curr.parent;
    }
    // Lock the node
    this.uuid = uuid;
    this.isLocked = true;
    // Release the locks on the ancestor nodes
    curr = node.parent;
    while (curr != null) {
        curr.release();
        curr = curr.parent;
    }
    release();
    return true;
}
```
