Here's the corrected code:
```typescript
import { writable } from 'svelte/store'

type Message =
  | { type: 'fetch' }
  | { type: 'set', payload: any }

type Actor = (state: any) => (message: Message) => Actor

type ExternalInterface = {
  send: (message: Message) => void
}

const apiWrapper: Actor = (state = { data: null, loading: false }) => (message) => {
  switch (message.type) {
    case 'fetch':
      return apiWrapper({ ...state, loading: true })

    case 'set':
      return apiWrapper({ data: message.payload, loading: false })

    default:
      return apiWrapper(state)
  }
}

const system = (actors: { [name: string]: Actor }) => {
  const receive = (name: string, message: Message) => {
    actors[name] = actors[name](message)
  }

  return { receive }
}

const actors = {
  apiWrapper: apiWrapper()
}

const { receive } = system(actors)

const restApiStore = () => {
  const { subscribe, set } = writable({ data: null, loading: false })

  const externalInterface: ExternalInterface = {
    send: (message) => {
      receive('apiWrapper', message)
    }
  }

  const fetch = async (url: string) => {
    externalInterface.send({ type: 'fetch' })
    const response = await fetch(url)
    const data = await response.json()
    externalInterface.send({ type: 'set', payload: data })
    set({ data, loading: false })
  }

  return {
    subscribe,
    fetch
  }
}

export const store = restApiStore()
```
In the `fetch` function, after receiving the `set` message with the `data` payload, the `set` function from the Svelte `writable` store is called with an object containing both `data` and `loading` properties. This updates the store state with the received data and sets `loading` to false.

