console.log(winners);

const losers = getPluralityWinnerOrLoser(electionData, true);
console.log(losers);
```
This function now creates a "data" array with candidate short names and their scores (number of first place votes) sorted in descending order. The "data" array is included in the returned object along with the "selected" array of winners or losers.

