This updated code replaces the A* algorithm with Dijkstra's algorithm. The key difference is that Dijkstra's algorithm does not use a heuristic function to estimate the distance to the goal, but instead considers all possible next states with a uniform cost. This makes it slower than A* in general, but guarantees that the solution found is optimal.

The code for Dijkstra's algorithm is very similar to that for A*, except that there is no need to keep track of the heuristic distance to the goal, and the priority queue uses the actual distance from the start state. The rest of the code is the same as before.

Note that Dijkstra's algorithm has a time complexity of O((mn)^2 log (mn)), where m and n are the dimensions of the grid, due to the need to explore all possible states. This makes it feasible for small grids like this one, but may not scale well to larger grids.
