In the example I gave, the mechanics depend on using a server-side data store like Redis or Memcached that caches the data. The idea is to fetch the data from the data store on the server side and then cache it, so that subsequent requests can access the data more quickly.

When `asyncData` is executed on the server side, it has access to the server-side data store, and can fetch the data synchronously from the cache. This means that the data can be returned directly from `asyncData` without using an asynchronous call.

Here's an example of how this might work with Redis:
```js
import redis from 'redis'
const client = redis.createClient()

export default {
  asyncData() {
    return new Promise((resolve, reject) => {
      client.get('mydata', (err, data) => {
        if (err) return reject(err)

        if (data) {
          // Data was found in cache, return it
          return resolve({ mydata: JSON.parse(data) })
        } else {
          // Data not found in cache, fetch it and store it in cache
          const mydata = { message: 'Hello world!' }
          client.set('mydata', JSON.stringify(mydata), () => {
            resolve({ mydata })
          })
        }
      })
    })
  }
}
```
In this example, `asyncData` is defined to return a Promise that resolves with the data. When executed on the server side, it checks if the data is available in the Redis cache using the `client.get` method. If the data is found in the cache, it returns it directly. If not, it fetches the data (in this case a static object with a `message` property), stores it in the cache using `client.set`, and then returns it.

Since the Redis `get` and `set` methods are synchronous, the `asyncData` method can fetch and return the data synchronously on the server side, without using an asynchronous call.

