You are right. It's not necessary to keep the container running after executing the command to calculate the volume size. We can use the `--rm` flag in conjunction with the `docker run` command to achieve this. Here's the updated `status` function that runs the temporary container just for the volume size calculation:
```go
func status(containerName, volumeName string, port int) {
	fmt.Printf("Checking NATS server status on port %d...\n", port)
	containerInfo, err := runCommandNoFatal("docker", "container", "inspect", containerName)
	if err != nil {
		fmt.Println("not running")
	} else {
		fmt.Println("running")
	}

	fmt.Printf("Checking volume usage for port %d...\n", port)
	runCommand("docker", "volume", "inspect", volumeName)

	fmt.Printf("Checking server port for container on port %d...\n", port)
	containerInfoLines := strings.Split(containerInfo, "\n")
	for _, line := range containerInfoLines {
		if strings.Contains(line, fmt.Sprintf("\"HostPort\": \"%d\"", port)) {
			fmt.Println(port)
			break
		}
	}

	// Create a temporary container to mount the volume and check its size, then remove it automatically
	volumeSize := runCommand("docker", "run", "--rm", "-v", fmt.Sprintf("%s:/data", volumeName), "alpine", "sh", "-c", "du -sh /data | cut -f1")

	fmt.Printf("Volume size: %s\n", strings.TrimSpace(volumeSize))
}
```
In this version of the `status` function, we removed the need for creating and stopping a separate container. The `docker run` command now directly calculates the volume size and removes the container once the command execution is finished.

