You are correct, thank you for bringing this to my attention. The `data` object passed to the `onSuccess` handler does not include the `fetchNextPage` method, so we cannot call it directly from there.

To access the `fetchNextPage` method, we need to store the return value of the `useInfiniteQuery` hook, which includes the `data`, `fetchNextPage`, and other properties and methods. We can then call `fetchNextPage` directly from the return value in the `onSuccess` handler.

Here's the updated implementation with the correct usage of `fetchNextPage`:
```javascript
import { useInfiniteQuery } from 'react-query';
import { API } from 'api-client'; // replace with your actual API client

function useAllResults() {
  const result = useInfiniteQuery(
    'results',
    async ({ pageParam = undefined }) => {
      const { results, nextToken } = await API.listResults(pageParam);
      return { results, nextToken };
    },
    {
      getNextPageParam: ({ nextToken }) => nextToken,
      select: (data) => {
        // accumulate the results and nextToken
        const results = data.pages.flatMap((page) => page.results);
        const nextToken = data.pages[data.pages.length - 1]?.nextToken;
        return { results, nextToken };
      },
    }
  );

  const { data, fetchNextPage } = result;

  // call fetchNextPage when there is a next page
  if (data?.nextToken) {
    result.fetchNextPage();
  }

  return result;
}

export default useAllResults;
```
In this implementation, we store the return value of `useInfiniteQuery` in the `result` variable and then destructure the `data` and `fetchNextPage` properties from it. We then call `fetchNextPage` directly in the `if` statement to trigger the next page fetch if there is a next page available.

