Certainly! Here is an example of a WebSocket server that uses a hash ring to redirect clients to different servers and sends a message to the client in the form of a JSON object with a more manageable API response. The server also checks if the client is already connected to the correct server before sending a redirect notification and stops accepting messages from the client if it needs to be redirected:
```typescript
import * as WebSocket from 'ws';
import * as crypto from 'crypto';

const serverList = ['server1', 'server2', 'server3'];

function getServer(clientIp: string) {
  const hash = crypto.createHash('md5').update(clientIp).digest('hex');
  const index = parseInt(hash, 16) % serverList.length;
  return serverList[index];
}

const wss = new WebSocket.Server({ port: 8080 });

wss.on('connection', (ws: WebSocket) => {
  const clientIp = ws.upgradeReq.connection.remoteAddress;
  const correctServer = getServer(clientIp);
  console.log(`Client ${clientIp} should be connected to ${correctServer}`);

  if (ws.upgradeReq.headers.host !== correctServer) {
    console.log(`Redirecting client ${clientIp} to ${correctServer}`);

    const message = {
      type: 'redirect',
      server: correctServer,
    };
    ws.send(JSON.stringify(message));

    ws.on('message', () => {});
  } else {
    console.log(`Client ${clientIp} is already connected to ${correctServer}`);

    ws.on('message', (message: string) => {
      console.log(`Received message from ${clientIp} => ${message}`);
    });
  }
});
```
This example checks the `host` header of the WebSocket upgrade request to determine which server the client is currently connected to. If the client is not connected to the correct server, the server sends a JSON object to the client to let it know which server it should be connected to and stops accepting messages from the client. If the client is already connected to the correct server, the server continues to accept messages from the client.

You can modify the `serverList` array to include the addresses of the servers that you want to redirect clients to. You can also use a different hashing function or a different approach to determine which server a client should be redirected to. You can also customize the JSON object to include any other information that you want to send to the client.

