```kotlin
class CouchbaseCluster(private val couchbaseSettings: WiskCouchbaseSettings) {

    private val logger: Logger = LoggerFactory.getLogger("wisk")

    fun connectToCluster(): Cluster {
        val env = ClusterEnvironment.builder()
            .timeoutConfig(
                TimeoutConfig
                    .kvTimeout(Duration.ofMillis(10000))
            )
            .build()

        val cluster = Cluster.connect(couchbaseSettings.serverHost,
            ClusterOptions.clusterOptions(
                PasswordAuthenticator.create(
                    couchbaseSettings.serverUsername,
                    couchbaseSettings.serverPassword
                )
            ).environment(env))

        createBucketIfNotExists(cluster, couchbaseSettings.bucketName)
        createIndexes(cluster, couchbaseSettings.bucketName)

        logger.info("Connected to Couchbase")
        return cluster
    }

    private fun createBucketIfNotExists(cluster: Cluster, bucketName: String) {
        val bucketManager = cluster.buckets()
        val bucketConfig = bucketManager.getBucketConfig(bucketName)
        if (bucketConfig == null) {
            bucketManager.createBucket(BucketSettings.create(bucketName).apply {
                quota(120)
                ramQuotaMB(100)
            })
        }
    }

    private fun createIndexes(cluster: Cluster, bucketName: String) {
        val bucket = cluster.bucket(bucketName)
        val indexManager = bucket.queryIndexes()
        val indexNames = indexManager.getAllIndexes().map { it.name() }
        if (!indexNames.contains("item_distributor_id_idx")) {
            indexManager.createIndex(
                "item_distributor_id_idx",
                Index.createIndex("item_distributor_id_idx").on(bucketName)
                    .using(IndexType.GSI).withDefer()
                    .addIndex()
            )
        }
    }
}
```
