In Spring MVC, `@ResponseBody` and `@RequestBody` are annotations used to handle HTTP request and response bodies in a more flexible and customizable way.

`@RequestBody` is used to map the request body to a Java object. When a request is received, Spring will automatically deserialize the request body into the specified Java object. This allows developers to easily receive and manipulate the data contained in the request body. For example, the following code snippet shows a controller method that uses `@RequestBody` to accept a JSON payload and map it to a Java object:
```less
@PostMapping("/users")
public ResponseEntity<User> createUser(@RequestBody User user) {
    // Do something with the user object
    return ResponseEntity.ok(user);
}
```
`@ResponseBody` is used to indicate that the method's return value should be serialized and sent as the response body. When a method annotated with `@ResponseBody` returns an object, Spring will automatically serialize it to the requested format (e.g. JSON or XML) and include it in the response body. For example:
```less
@GetMapping("/users/{id}")
@ResponseBody
public User getUser(@PathVariable Long id) {
    User user = userRepository.findById(id);
    return user;
}
```
Here, the `getUser` method returns a `User` object, and Spring automatically serializes it to JSON and includes it in the response body.

Using `@RequestBody` and `@ResponseBody` can be especially useful when working with APIs that use non-standard data formats, such as JSON or XML, or when you want more control over the serialization and deserialization process.

Interface:

1. An interface is used to define a contract for a set of methods that a class must implement. This allows for loose coupling between classes and promotes the principle of "programming to an interface." An example of this is a shape interface that contains a method for calculating the area, and then having concrete classes such as Square and Circle that implement the shape interface and provide their own implementation of the method for calculating the area specific to their shapes.
```
interface Shape {
    double getArea();
}

class Square implements Shape {
    private double side;
    public Square(double side) {
        this.side = side;
    }
    @Override
    public double getArea() {
        return side * side;
    }
}
```
2. Yes, interfaces in Java support multiple inheritance. You can implement multiple interfaces in a class by using the keyword "implements" followed by the interface names.
```
interface Shape {
    double getArea();
}

interface Printable {
    void print();
}

class Square implements Shape, Printable {
    private double side;
    public Square(double side) {
        this.side = side;
    }
    @Override
    public double getArea() {
        return side * side;
    }
    @Override
    public void print() {
        System.out.println("Square with side " + side);
    }
}
```
3. You can achieve multiple inheritance with interfaces by a class implementing multiple interfaces.
4. You can use an interface by creating an instance of a concrete class that implements the interface and then calling the methods defined in the interface.
5. The access specifier used for the members of interfaces is "public" by default.
6. Yes, interfaces can be used to achieve complete or full abstraction because all the methods in an interface are abstract by default and must be implemented by the class that implements the interface.
7. Yes, a class can implement multiple interfaces in Java.
8. An example of an interface in the real world is a remote control. It defines a set of buttons and their functionality (volume up, volume down, power on/off etc.) that any electronic device that wants to be controlled remotely must implement.

