public List<RGB> GetRandomColors(List<RGB> allColors, int numberOfColorsToSelect, bool allowDupes)
{
    Random rand = new Random();
    List<RGB> selectedColors = new List<RGB>();
    int currentSize = allColors.Count;
    for (int i = 0; i < numberOfColorsToSelect; i++)
    {
        int randomIndex = rand.Next(currentSize);
        if(!allowDupes && selectedColors.Contains(allColors[randomIndex]))
        {
            i--;
            continue;
        }
        selectedColors.Add(allColors[randomIndex]);
        RGB temp = allColors[randomIndex];
        --currentSize;
        allColors[randomIndex] = allColors[currentSize];
        allColors[currentSize] = temp;
    }
    return selectedColors;
}
