        $this->load();
    }

    public function __get($name) {
        return $this->records[$name];
    }

    public function __set($name, $value) {
        $this->records[$name] = $value;
    }

    public function __call($method, $arguments) {
        if ($method == "create") {
            $this->createRecord($arguments[0]);
        } else if ($method == "read") {
            return $this->readRecord($arguments[0]);
        } else if ($method == "update") {
            $this->updateRecord($arguments[0], $arguments[1]);
        } else if ($method == "delete") {
            $this->deleteRecord($arguments[0]);
        }
    }

    private function load() {
        // load the records and structure from the flat file database into the $records and $structure arrays
    }

    private function save() {
        // save the records and structure from the $records and $structure arrays into the flat file database
    }

    private function createRecord($record) {
        if (empty($this->structure)) {
            $this->structure = array_keys($record);
        } else {
            $this->structure = array_unique(array_merge($this->structure, array_keys($record)));
        }

        $id = count($this->records) + 1;
        $record["id"] = $id;
        $this->records[$id] = $record;
        $this->save();
    }

    private function readRecord($id) {
        return $this->records[$id];
    }

    private function updateRecord($id, $record) {
        $this->structure = array_unique(array_merge($this->structure, array_keys($record)));
        $this->records[$id] = $record;
        $this->save();
    }

    private function deleteRecord($id) {
        unset($this->records[$id]);
        $this->save();
    }

    public function getStructure() {
        return $this->structure;
    }

    public function addField($field) {
        $this->structure[] = $field;
        $this->save();
    }

    public function removeField($field) {
        $key = array_search($field, $this->structure);
        if ($key !== false) {
            unset($this->structure[$key]);
            $this->save();
        }
    }
}
